$(function () {
	window.App = {
			Models: {},
			Views: {},
			Collections: {},
			Router: {}
	}
	App.Views.Something = Backbone.View.extend({
		initialize: function () {
			$('#something').html('<% @guilds %>')
		}
	})

	new App.Views.Something();
}());
